                As a Front-End Developer, 
                I am passionate about transforming creative designs into interactive, user-friendly web experiences. With a solid foundation in modern web technologies and a keen eye for detail, I specialize in crafting responsive and visually appealing interfaces that provide a seamless user experience across various devices and browsers.
            </div>
        </div>
    )
}

export default HomePage;
